        var url = 'https://s3.amazonaws.com/centrallysteamboat/assets/';
        var size = 'medium';
        function showTime(time) {
            var list = data[time].values;
            var posts = '';
            var assigned = {};
            for (var i=0; i < list.length; i++) {
                var val = list[i];
                var hash = val[1] + val[2] + val[3];
                if (assigned[hash]) continue;

                assigned[hash] = true;
                posts += '<div class="col-sm-3">';
                posts += '<div class="card"><img class="card-img-top" src="' + url + val[0] + '/' + size + '/' + val[1] + '">';
                posts += '<div class="card-block"><h4 class="card-title">' + val[2] + '</h4><p class="card-text">Score <strong>' + val[3] + '</strong></p></div>';
                posts += '</div></div>';
            }
            $('.posts').html(posts);
        }
        showTime('00');
        $('select').on('change', function(event) {
            showTime($(event.currentTarget).val());
        })
    </script>
